AOS.init();

const tooltipTriggerList = document.querySelectorAll('[data-bs-toggle="tooltip"]')
const tooltipList = [...tooltipTriggerList].map(tooltipTriggerEl => new bootstrap.Tooltip(tooltipTriggerEl))




const triggerTabList = document.querySelectorAll("#pills-tab a");
triggerTabList.forEach((triggerEl) => {
  const tabTrigger = new bootstrap.Tab(triggerEl);

  triggerEl.addEventListener("click", (event) => {
    event.preventDefault();
    tabTrigger.show();
  });
});




  const navTabs = $('.nav.nav-tabs');
  const scrollAmount = 200; 
  arrowLeft();
  arrowRight();

  $('.nav-tabs .fas.fa-angle-left').on('click', function() {
      
      if (navTabs.length >= 0) {
          navTabs.scrollLeft(navTabs.scrollLeft() - scrollAmount);

          arrowLeft();
          arrowRight();
      }
      
  });

  $('.nav-tabs .fas.fa-angle-right').on('click', function() {
      
      if (navTabs.length >= 0) {
          navTabs.scrollLeft(navTabs.scrollLeft() + scrollAmount);
      
          arrowLeft();
          arrowRight();
        
          
      $('.nav-tabs .fas.fa-angle-left').css('display', 'flex');
    }
  });

function arrowLeft() {
  if (navTabs.scrollLeft() === 0) {
    $('.nav-tabs .fas.fa-angle-left').css('display', 'none');
  } else {
    $('.nav-tabs .fas.fa-angle-left').css('display', 'flex');
  }
}
function arrowRight() {
  if (navTabs && navTabs[0]) {
  if (navTabs.scrollLeft() + navTabs.innerWidth() >= (navTabs[0].scrollWidth - 10)) {
    $('.nav-tabs .fas.fa-angle-right').css('display', 'none');
  } else {
      $('.nav-tabs .fas.fa-angle-right').css('display', 'flex');
  }
}
}




var showPasswordButtons = document.querySelectorAll('.show_password');

showPasswordButtons.forEach(function(button) {
  
    button.addEventListener("click", function() {
        var input = this.parentElement.querySelector('.form-control.password');
        var icon = this.querySelector('i');
        
        if (input.type === 'password') {
            input.type = 'text';
            icon.classList.remove('fa-eye-slash');
            icon.classList.add('fa-eye');
        } else {
            input.type = 'password';
            icon.classList.remove('fa-eye');
            icon.classList.add('fa-eye-slash');
        }
    });
});



var moreLinks = document.querySelectorAll('.more_link');
moreLinks.forEach(function(link) {
  link.addEventListener('click', function (e) {
    e.preventDefault();
    var tab = document.getElementById(link.getAttribute('data-tab-target'));
    if(tab) {
      tab.click();
      window.scrollTo(0, 0);
    }
  });
});


